import React from 'react';

const MovieDetails = ({ movie }) => {
  return movie ? (
    <div>
      <h2>{movie.Title}</h2>
      <img src={movie.Poster} alt={movie.Title} />
      <p>{movie.Plot}</p>
      <p>Oyuncular: {movie.Actors}</p>
      <p>IMDB Puanı: {movie.imdbRating}</p>
    </div>
  ) : null;
};

export default MovieDetails;
